## Available Scripts

- `yarn start`: Start the application
- `yarn start:dev`: Start in development mode with hot-reload
- `yarn start:debug`: Start in debug mode
- `yarn start:prod`: Start in production mode
- `yarn test`: Run tests
- `yarn test:watch`: Run tests in watch mode
- `yarn test:cov`: Run tests with coverage
- `yarn test:e2e`: Run end-to-end tests
- `yarn lint`: Run linter
- `yarn format`: Format code with Prettier

## Examples

### Creating a New Module

```typescript
// src/modules/example/example.module.ts
import { Module } from '@nestjs/common';
import { ExampleController } from './example.controller';
import { ExampleService } from './example.service';

@Module({
  controllers: [ExampleController],
  providers: [ExampleService],
  exports: [ExampleService],
})
export class ExampleModule {}
```

### Creating a Service

```typescript
// src/modules/example/example.service.ts
import { Injectable } from '@nestjs/common';
import { InjectModel } from '@nestjs/mongoose';
import { Model } from 'mongoose';
import { Example } from './schemas/example.schema';

@Injectable()
export class ExampleService {
  constructor(
    @InjectModel(Example.name) private exampleModel: Model<Example>,
  ) {}

  async create(data: any): Promise<Example> {
    const created = new this.exampleModel(data);
    return created.save();
  }
}
```

### Creating a Controller

```typescript
// src/modules/example/example.controller.ts
import { Controller, Post, Body } from '@nestjs/common';
import { ExampleService } from './example.service';
import { CreateExampleDto } from './dto/create-example.dto';

@Controller('example')
export class ExampleController {
  constructor(private readonly exampleService: ExampleService) {}

  @Post()
  async create(@Body() createExampleDto: CreateExampleDto) {
    return this.exampleService.create(createExampleDto);
  }
}
```

## Hedera Integration

The boilerplate includes pre-configured Hedera client setup:

```typescript
// Example of using Hedera client
import { Client, PrivateKey } from '@hashgraph/sdk';

const client = Client.forTestnet();
client.setOperator(process.env.HEDERA_OPERATOR_ID, process.env.HEDERA_OPERATOR_KEY);
```

## Authentication

The application supports multiple authentication methods:

1.

JWT Authentication
2. API Key Authentication
3. Custom Authentication

Example of protected route:

```typescript
@UseGuards(JwtAuthGuard)
@Get('protected')
async getProtectedData() {
  return { message: 'This is protected data' };
}
```

## Monitoring

The application includes OpenTelemetry for monitoring:

- Prometheus metrics endpoint at `/metrics`
- Jaeger tracing
- Custom metrics collection

## Testing

The boilerplate includes Jest for testing:

```typescript
// Example test
describe('ExampleService', () => {
  let service: ExampleService;

  beforeEach(async () => {
    const module: TestingModule = await Test.createTestingModule({
      providers: [ExampleService],
    }).compile();

    service = module.get<ExampleService>(ExampleService);
  });

  it('should be defined', () => {
    expect(service).toBeDefined();
  });
});
```

