import { registerAs } from "@nestjs/config";
import { LedgerId } from "@hashgraph/sdk";
import { IClient } from "@hsuite/client-types";

/**
 * Client configuration module. * @module ClientConfig
 */

/**
 * Registers and exports the client configuration. * @function
 * @returns {IClient.IOptions} The client configuration object. */
export default registerAs('client', (): IClient.IOptions => ({
    /**
     * Indicates whether the client is enabled. * @type {boolean}
     */
    enabled: true,

    /**
     * The environment (network) the client is operating in. * @type {LedgerId}
     */
    environment: LedgerId.fromString(process.env.CLIENT_ENV),

    /**
     * The base URL for Smart Node, empty to use random node
     * @type {string}
     */
    baseUrl: process.env.BASE_URL,

    /**
     * The operator account details for the client. * @type {Object}
     * @property {string} accountId - The account ID of the operator. * @property {string} privateKey - The private key of the operator. * @property {string} publicKey - The public key of the operator. */
    operator: process.env.NODE_ENV == 'mainnet' ? {
        accountId: process.env.PROD_NODE_ID,
        privateKey: process.env.PROD_NODE_PRIVATE_KEY,
        publicKey: process.env.PROD_NODE_PUBLIC_KEY
    } : {
        accountId: process.env.DEV_NODE_ID,
        privateKey: process.env.DEV_NODE_PRIVATE_KEY,
        publicKey: process.env.DEV_NODE_PUBLIC_KEY
    }
}));

