/**
 * @class TopicsService
 * @description Service for managing Hedera Consensus Service (HCS) topics
 * 
 * This service provides core functionality for interacting with the Hedera Consensus Service,
 * including topic creation, message submission, and information retrieval. It leverages the
 * SmartNodeSdkService for Hedera network operations and implements proper error handling
 * and logging.

* 
 * @example
 * ```typescript
 * // Example usage in a NestJS service
 * @Injectable()
 * class MyService {
 *   constructor(private readonly topicsService: TopicsService) {}
 * 
 *   async createAndPostMessage() {
 *     const topicId = await this.topicsService.createTopic('My App Messages');
 *     await this.topicsService.submitMessage(topicId, 'Hello World!');
 *   }
 * }
 * ```
 * 
 * @see SmartNodeSdkService
 * @see LoggerHelper
 * @see HashgraphClientHelper
 */
@Injectable()
export class TopicsService {
  /**
   * Logger instance for service operations
   * @private
   */
  private readonly logger = new LoggerHelper(TopicsService.name);

  /**
   * Hedera client instance for network interactions
   * @private
   */
  private client: Client;

  /**
   * Operator credentials for transaction signing
   * @private
   */
  private operator: IHashgraph.IOperator;

  /**
   * Creates an instance of the TopicsService
   * 
   * @param clientService - Client service for API communication
   * @param smartConfigService - Configuration service for network settings
   * @param smartNodeSdkService - SDK service for Hedera network operations
   * 
   * @throws {Error} If operator credentials cannot be retrieved
   */
  constructor(
    private readonly clientService: ClientService,
    private readonly smartConfigService: SmartConfigService,
    private readonly smartNodeSdkService: SmartNodeSdkService
  ) {
    this.operator = this.smartConfigService.getOperator();

    HashgraphClientHelper.initialize(
      LedgerId.fromString(this.smartConfigService.getEnvironment()),
      this.operator,
      this.smartConfigService.getMirrorNode()
    );

    this.client = HashgraphClientHelper.getInstance().getClient();      
  }

  /**
   * Creates a new topic on the Hedera network
   * 
   * @param {Omit<IHashgraph.ILedger.IHCS.ITopic.ICreate, 'validatorConsensusTimestamp'>} params - Parameters for topic creation
   * @returns {Promise<string>} The ID of the created topic
   * 
   * @throws {Error} If topic creation fails due to:
   * - Network connectivity issues
   * - Invalid operator credentials
   * - Transaction execution failure
   * 
   * @example
   * ```typescript
   * // Create a topic with a custom memo
   * const topicId = await topicsService.createTopic({
   *   memo: 'My app messages',
   *   validatorConsensusTimestamp: new Date().toISOString()
   * });
   * console.log(`Created topic: ${topicId}`);
   * ```
   */
  async createTopic(
    params: Omit<IHashgraph.ILedger.IHCS.ITopic.ICreate, 'validatorConsensusTimestamp'>
  ): Promise<string> {
    try {
      const validatorConsensusTimestamp = await this.smartNodeSdkService.validatorsRestful
        .addConsensusValidator(exampleTopicsValidator as any);

      // Generate transaction bytes using the Smart Node SDK
      const createTopicTxBytes = await this.smartNodeSdkService.hcsHashgraphRestful.createTopic({
        ...params,
        validatorConsensusTimestamp
      });

      // Convert bytes to transaction object
      const createTopicTx = Transaction.fromBytes(
        new Uint8Array(Buffer.from(createTopicTxBytes))
      );

      // Sign the transaction with operator key
      const signedTx = await createTopicTx.sign(
        PrivateKey.fromString(this.operator.privateKey)
      );

      // Execute the transaction and get receipt
      const txResponse = await signedTx.execute(this.client);
      const receipt = await txResponse.getReceipt(this.client);

      // Return the new topic ID
      return receipt.topicId.toString();
    } catch (error) {
      this.logger.error(`Failed to create topic: ${error.message}`);
      throw error;
    }
  }

  /**
   * Submits a message to an existing topic
   * 
   * @param params - Parameters for message submission
   * @returns {Promise<string>} The transaction ID of the submission
   * 
   * @throws {Error} If message submission fails due to:
   * - Invalid topic ID
   * - Network connectivity issues
   * - Transaction execution failure
   * 
   * @example
   * ```typescript
   * // Submit a simple text message
   * const txId = await topicsService.submitMessage({
   *   topicId: '0.0.12345',
   *   message: 'Hello from Smart App!'
   * });
   * 
   * // Submit a JSON message
   * const jsonMessage = JSON.stringify({ event: 'user_login', userId: '123' });
   * const jsonTxId = await topicsService.submitMessage({
   *   topicId: '0.0.12345',
   *   message: jsonMessage
   * });
   * ```
   */
  async submitMessage(
    topicId: string,
    params: IHashgraph.ILedger.IHCS.ITopic.IMessage.ISubmit
  ): Promise<string> {
    try {
      // Generate transaction bytes for submitting a message
      const submitMsgTxBytes = await this.smartNodeSdkService.hcsHashgraphRestful.submitMessage(topicId, params);

      // Convert bytes to transaction object
      const submitMsgTx = Transaction.fromBytes(
        new Uint8Array(Buffer.from(submitMsgTxBytes))
      );

      // Sign transaction with operator key
      const signedTx = await submitMsgTx.sign(
        PrivateKey.fromString(this.operator.privateKey)
      );

      // Execute transaction
      const txResponse = await signedTx.execute(this.client);

      // Return the transaction ID
      return txResponse.transactionId.toString();
    } catch (error) {
      this.logger.error(`Failed to submit message: ${error.message}`);
      throw error;
    }
  }

  /**
   * Retrieves message history for a topic
   * 
   * @param topicId - ID of the topic to query
   * @param encoding - Message encoding format
   * @param limit - Maximum number of messages to retrieve
   * @param order - Sort order (asc/desc)
   * @param sequenceNumber - Starting sequence number
   * @param timestamp - Starting timestamp
   * @returns {Promise<Hashgraph.Restful.HCS.Message.Entity[]>} Array of messages with sequence numbers and timestamps
   * 
   * @throws {Error} If message retrieval fails due to:
   * - Invalid topic ID
   * - Network connectivity issues
   * - Mirror node query failure
   * 
   * @example
   * ```typescript
   * // Get last 10 messages
   * const messages = await topicsService.getTopicMessages({
   *   callbackSuccess: (msg) => console.log(`Message: ${msg.contents}`),
   *   callbackError: (msg, err) => console.error(`Error: ${err.message}`),
   *   start: 0,
   *   end: 10,
   *   limit: 10
   * });
   * ```
   */
  async getTopicMessages(
    topicId: string,
    encoding?: string,
    limit?: number,
    order?: string,
    sequenceNumber?: number,
    timestamp?: string
  ): Promise<Hashgraph.Restful.HCS.Message.Entity[]> {
    try {
      // Use the Smart Node SDK to query the mirror node for messages
      return await this.smartNodeSdkService.hcsHashgraphRestful.getRestfulMessages(
        topicId,
        encoding,
        limit,
        order,
        sequenceNumber,
        timestamp
      );
    } catch (error) {
      this.logger.error(`Failed to retrieve topic messages: ${error.message}`);
      throw error;
    }
  }

  /**
   * Gets information about a specific topic
   * 
   * @param topicId - ID of the topic to query
   * @returns {Promise<IHashgraph.ILedger.IHCS.ITopic.IInfo>} Detailed information about the topic
   * 
   * @throws {Error} If topic information retrieval fails due to:
   * - Invalid topic ID
   * - Network connectivity issues
   * - Mirror node query failure
   * 
   * @example
   * ```typescript
   * // Get basic topic information
   * const topicInfo = await topicsService.getTopicInfo('0.0.12345');
   * console.log(`Topic memo: ${topicInfo.topicMemo}`);
   * console.log(`Created at: ${topicInfo.expirationTime}`);
   * 
   * // Check if topic has admin key
   * if (topicInfo.adminKey) {
   *   console.log('Topic has admin key configured');
   * }
   * ```
   */
  async getTopicInfo(topicId: string): Promise<IHashgraph.ILedger.IHCS.ITopic.IInfo> {
    try {
      // Use the Smart Node SDK to query topic information
      return await this.smartNodeSdkService.hcsHashgraphRestful.getTopicInfo(topicId);
    } catch (error) {
      this.logger.error(`Failed to retrieve topic info: ${error.message}`);
      throw error;
    }
  }
}

import { BadRequestException, Controller, Get } from '@nestjs/common';
import { SmartAppService } from './smart-app.service';
import { ApiNotFoundResponse, ApiBadRequestResponse, ApiOkResponse, ApiOperation, ApiTags } from '@hsuite/nestjs-swagger';
import { Public } from '@hsuite/auth-types';

/**
 * @class SmartAppController
 * @description Controller responsible for handling Smart Application related endpoints
 * 
 * This controller provides API endpoints for retrieving information about the Smart Application
 * and its connection to the Smart Node network. It exposes public endpoints that return
 * identification and subscription details for the application and connected node operator. * 
 * All endpoints in this controller are marked as public (@Public decorator), meaning they
 * don't require authentication tokens, but some operations may still check user context
 * internally if the user is authenticated. * 
 * @category Controllers
 * @example
 * // Example request to get Smart Node identifier
 * GET /smart-app/smart-node-identifier
 * 
 * // Example request to get Smart App identifier
 * GET /smart-app/smart-app-identifier
 */
@Controller('smart-app')
@ApiTags('smart-app')
@Public()
export class SmartAppController {
  /**
   * @constructor
   * @param {SmartAppService} smartAppService - Service that handles Smart App business logic
   * @description Initializes the controller with required dependencies
   */
  constructor(
    private readonly smartAppService: SmartAppService
  ) {}

  /**
   * @method smartNodeIdentifier
   * @description Retrieves the identifier and details of the SmartNodeOperator connected to this application
   * 
   * This endpoint fetches comprehensive information about the Smart Node Operator that this
   * Smart Application is connected to. The information includes the operator's network identity,
   * connection status, and operational details.

* 
   * @returns {Promise<any>} Object containing SmartNodeOperator details including identifier, 
   *                         network status, and connection information
   * @throws {BadRequestException} If the Smart Node connection fails or returns an error
   * 
   * @example
   * // Example response
   * {
   *   "operatorId": "0.0.12345",
   *   "status": "active",
   *   "networkType": "mainnet",
   *   "connectionDetails": {
   *     "lastSeen": "2023-06-15T10:30:45Z",
   *     "uptime": "99.8%"
   *   }
   * }
   */
  @ApiOperation({
    summary: 'get the identifier of the SmartNodeOperator this SmartApp is connected to',
    description: 'This endpoint is only available if the user is authenticated. \
    It will return the details about the SmartNodeOperator.'
  })
  @ApiOkResponse({
    type: Object,
    status: 200,
    description: "Returns a SmartNodeOperator."
  })
  @ApiNotFoundResponse({
    description: "Smart Node Operator not found or connection not established"
  })
  @ApiBadRequestResponse({
    description: "Invalid request or error retrieving Smart Node Operator details"
  })
  @Get('smart-node-identifier')
  async smartNodeIdentifier(): Promise<any> {
    try {
      return await this.smartAppService.smartNodeIdentifier();
    } catch(error) {
      throw new BadRequestException(error.message);
    }
  }

  /**
   * @method smartAppIdentifier
   * @description Retrieves the identifier and subscription details for the current Smart Application
   * 
   * This endpoint provides detailed information about the Smart Application itself, including
   * its unique identifier, subscription status, and available features. If a user is authenticated,
   * it will also include user-specific subscription information and access levels. * 
   * The subscription details include plan type, expiration dates, feature access, and usage metrics
   * that help determine the application's capabilities and limitations.

* 
   * @returns {Promise<any>} Object containing Smart Application identifier and subscription details
   * @throws {BadRequestException} If there's an error retrieving application details or subscription information
   * 
   * @example
   * // Example response
   * {
   *   "appId": "smart-app-7890",
   *   "version": "2.3.1",
   *   "subscription": {
   *     "plan": "enterprise",
   *     "status": "active",
   *     "expiresAt": "2024-12-31T23:59:59Z",
   *     "features": ["advanced-analytics", "custom-integrations", "priority-support"],
   *     "usage": {
   *       "apiCalls": {
   *         "used": 12500,
   *         "limit": 100000
   *       }
   *     }
   *   }
   * }
   */
  @ApiOperation({
    summary: 'get subscription status for the logged in user.',
    description: 'This endpoint is only available if the user is authenticated. \
    It will return the subscription details.'
  })
  @ApiOkResponse({
    type: Object,
    status: 200,
    description: "Returns an object containing Smart Application identifier and subscription details"
  })
  @ApiNotFoundResponse({
    description: "Smart Application details or subscription information not found"
  })
  @ApiBadRequestResponse({
    description: "Invalid request or error retrieving Smart Application details"
  })
  @Get('smart-app-identifier')
  async smartAppIdentifier(): Promise<any> {
    try {
      return await this.smartAppService.smartAppIdentifier();
    } catch(error) {
      throw new BadRequestException(error.message);
    }
  }
}

