/**
 * @class SmartAppModule
 * @description Core module for the Smart Application that orchestrates all application components
 * 
 * This module serves as the central hub for the entire Smart Application, integrating all core and optional
 * modules required for the application to function.

* 
 * @example
 * // Bootstrap the application with the SmartAppModule
 * const app = await NestFactory.create(SmartAppModule.register());
 */
@Module({
  imports: [
    /**
     * Global configuration module that loads all application settings
     * from environment variables and configuration files
     */
    ConfigModule.forRoot({
      isGlobal: true,
      cache: true,
      envFilePath: '.smart_app.env',
      load: [
        authentication,
        client,
        mongoDb,
        throttler,
        redis,
        smartConfig,
        ipfs,
        subscription
      ]
    }),
    /**
     * Enables scheduled tasks and cron jobs throughout the application
     */
    ScheduleModule.forRoot(),
    /**
     * Redis-based caching system for improved performance
     * Configured asynchronously based on application settings
     */
    CacheModule.registerAsync<RedisClientOptions & Config>({
      isGlobal: true,
      imports: [ConfigModule],
      inject: [ConfigService],
      useFactory: async (configService: ConfigService) => {
        const redisConfig = configService.getOrThrow<RedisClientOptions & Config>('redis');
        return {
          store: await redisStore(redisConfig),
        };
      }
    }),
    /**
     * MongoDB connection for persistent data storage
     * Configured asynchronously based on application settings
     */
    MongooseModule.forRootAsync({
      imports: [ConfigModule],
      inject: [ConfigService],
      useFactory: async (configService: ConfigService) => ({
        uri: configService.getOrThrow<{url: string}>('mongoDb').url
      })
    }),
    /**
     * Event emitter for application-wide event handling
     * Enables publish/subscribe patterns throughout the application
     */
    EventEmitterModule.forRoot({
      wildcard: false,
      delimiter: '.',
      newListener: true,
      removeListener: true,
      maxListeners: 10,
      verboseMemoryLeak: true,
      ignoreErrors: false
    }),
    /**
     * Static file serving for public assets
     * Serves files from the public directory with appropriate security settings
     */
    ServeStaticModule.forRoot({
      rootPath: join(__dirname, '..', '../public'),
      serveRoot: '/public/',
      exclude: ["/api*"],
    })
  ],
  controllers: [
    SmartAppController
  ],
  providers: [
    SmartAppService,
    /**
     * Global cache interceptor for automatic response caching
     * Applies caching to all eligible endpoints based on cache settings
     */
    {
      provide: APP_INTERCEPTOR,
      useClass: CacheInterceptor,
    }
  ]
})
export class SmartAppModule {
  /**
   * @method register
   * @description Dynamically registers all required and optional modules based on configuration
   * 
   * This static factory method creates a dynamic module configuration that:
   * 1.

* 
   * @returns {DynamicModule} A dynamically configured SmartAppModule with all necessary imports
   */
  static register(): DynamicModule {
    return {
      module: SmartAppModule,
      imports: [
        // Smart Node - Core Modules
        /**
         * IPFS Module for decentralized storage capabilities
         * Provides file storage and retrieval through IPFS protocol
         */
        IpfsModule.forRootAsync({
          imports: [ConfigModule],
          useExisting: [ConfigService],
          inject: [ConfigService],
          useFactory: async (configService: ConfigService) => ({
            ...configService.getOrThrow<IIPFS.IOptions>('ipfs')
          })
        }),
        /**
         * Security Throttler Module for rate limiting and DDOS protection
         * Prevents abuse of API endpoints by limiting request frequency
         */
        SecurityThrottlerModule.forRootAsync({
          imports: [ConfigModule],
          useExisting: [ConfigService],
          inject: [ConfigService],
          useFactory: async (configService: ConfigService) => ({
            ...configService.getOrThrow<IThrottler.IOptions>('throttler')
          })
        }),
        /**
         * Smart Config Module for network and application configuration
         * Manages application settings and network connectivity parameters
         */
        SmartConfigModule.forRootAsync({
          imports: [ConfigModule],
          useExisting: [ConfigService],
          inject: [ConfigService],
          useFactory: async (configService: ConfigService) => ({
            ...configService.getOrThrow<ISmartNetwork.INetwork.IConfig.IOptions>('smartConfig')
          })
        }),
        /**
         * Smart Node SDK Module for interacting with the Hedera network
         * Provides core functionality for blockchain interactions
         */
        SmartNodeSdkModule.forRootAsync({
          imports: [ConfigModule, SmartConfigModule],
          useExisting: [ConfigService, SmartConfigService],
          useFactory: async (configService: ConfigService) => ({
            client: configService.getOrThrow<IClient.IOptions>('client')
          })
        }),
        /**
         * Conditional Authentication Module configuration
         * Only loaded if authentication is enabled in application settings
         */
        ...(
          authentication().enabled ?

[AuthModule.forRootAsync({
            imports: [ConfigModule, ClientModule],
            useExisting: [ConfigService, ClientService],
            inject: [ConfigService, ClientService],
            useFactory: async (configService: ConfigService, clientService: ClientService) => ({
              ...configService.getOrThrow<IAuth.IConfiguration.IAuthentication>('authentication')
            }),
            config: {
              passport: authentication().commonOptions.passport,
              module: 'web3',
              options: {
                  confirmation_required: authentication().web2Options.confirmation_required,
                  admin_only: authentication().web2Options.admin_only,
                  enable_2fa: authentication().web2Options.twilioOptions.enabled
              }                
            }
          })] : []
        ),
        /**
         * Conditional Subscription Module configuration
         * Only loaded if subscription services are enabled in application settings
         * Provides functionality for managing user subscriptions, token gating, and issuer services
         */
        ...(
          subscription().enabled ?

[SubscriptionsModule.forRootAsync({
            imports: [ConfigModule, SmartConfigModule],
            useExisting: [ConfigService, SmartConfigService],
            inject: [ConfigService, SmartConfigService],
            jwt: authentication().commonOptions.jwt,
            enableIssuer: subscription().issuer.enabled,
            enableTokenGate: subscription().tokenGate.enabled,
            useFactory: async (
              configService: ConfigService,
              smartConfigService: SmartConfigService
            ) => ({
              subscription: {
                ...configService.getOrThrow<ISubscription.IConfig.IOptions>('subscription'),
                utilities: []
              },
              bull: {
                redis: configService.getOrThrow<ISubscription.IConfig.IRedis>('subscription.issuer.options.redis'),
                defaultJobOptions: {
                  attempts: 5,
                  backoff: {
                    type: 'exponential',
                    delay: 1000
                  },
                  removeOnComplete: true,
                  removeOnFail: false
                }
              }
            })
          })] : []
        ),      
        /**
         * Showcase modules for demonstrating Smart Node SDK functionality:
         * - TopicsModule: Demonstrates Hedera Consensus Service (HCS) operations
         * - AccountsModule: Demonstrates Hedera account operations
         * - TokensModule: Demonstrates Hedera Token Service (HTS) operations
         */
        TopicsModule,
        AccountsModule,
        TokensModule
      ],
      providers: []
    };
  }
}

import { Injectable, OnModuleInit } from '@nestjs/common';
import { ClientService } from '@hsuite/client';
import { IHashgraph } from '@hsuite/hashgraph-types';
import { Client, LedgerId, PrivateKey, Transaction } from '@hashgraph/sdk';
import { AxiosError } from 'axios';
import { Web3Socket } from './sockets/socket.class';
import { SmartConfigService } from '@hsuite/smart-config';
import { SmartNodeSdkService } from '@hsuite/smartnode-sdk';
import { ISmartNetwork } from '@hsuite/smart-network-types';
import { HashgraphClientHelper } from '@hsuite/helpers';
import { LoggerHelper } from '@hsuite/helpers';

/**
 * SmartAppService class
 * 
 * @description
 * Core service responsible for initializing and managing the Smart Application's
 * connection to the Hedera network. This service handles:
 * 
 * - Hedera client initialization and configuration
 * - Network operator management
 * - WebSocket connections for real-time updates
 * - Transaction creation, signing, and submission
 * - Smart Node and Smart App identification
 * 
 * The service acts as a bridge between the application and the Hedera network,
 * providing a unified interface for all Hedera-related operations. * 
 * @example
 * ```typescript
 * // Inject the service in a controller
 * constructor(private readonly smartAppService: SmartAppService) {}
 * 
 * // Get Smart Node identifier
 * async getNodeIdentifier() {
 *   const identifier = await this.smartAppService.smartNodeIdentifier();
 *   return identifier;
 * }
 * ```
 */
@Injectable()
export class SmartAppService implements OnModuleInit {
  /**
   * Logger instance for logging messages
   * 
   * @description
   * Provides structured logging capabilities throughout the service. * Uses the class name as the context for all log messages.

* 
   * @param smartClient - Service for handling authentication and API requests
   * @param smartConfigService - Service for accessing application configuration
   * @param smartNodeSdkService - Service for interacting with Smart Node SDK
   */
  constructor(
    private readonly smartClient: ClientService,
    private readonly smartConfigService: SmartConfigService,
    private readonly smartNodeSdkService: SmartNodeSdkService
  ) {
    this.environment = this.smartConfigService.getEnvironment();
    this.operator = this.smartConfigService.getOperator();

    HashgraphClientHelper.initialize(
      LedgerId.fromString(this.smartConfigService.getEnvironment()),
      this.operator,
      this.smartConfigService.getMirrorNode()
    );

    this.client = HashgraphClientHelper.getInstance().getClient();    
  }

  /**
   * Lifecycle hook that runs when the module is initialized
   * 
   * @description
   * Performs initial setup tasks when the application starts:
   * 1. Retrieves the user session information
   * 2. Creates a new HCS topic for wallet operations
   * 3. Signs and submits the transaction to the Hedera network
   * 4. Logs the resulting topic ID
   * 
   * @throws Will log errors that occur during initialization
   */
  async onModuleInit(): Promise<void> {
    try {
      // just as a showcase, to demonstrate the connection to the Smart Node API
      let session = await this.smartClient.axios.get('/auth/profile');
      console.log(JSON.stringify(session.data));
    } catch (error) {
      if (error instanceof AxiosError) {
        this.logger.error(error.response.data.message);
      } else {
        this.logger.error(error.message);
      }
    }
  }

  /**
   * Retrieves the Smart Node identifier information
   * 
   * @description
   * Fetches identification details about the connected Smart Node,
   * including network information, node status, and capabilities.

* 
   * @returns Promise resolving to the Smart Node identifier entity
   * @throws Will reject the promise if the API request fails
   * 
   * @example
   * ```typescript
   * try {
   *   const nodeInfo = await smartAppService.smartNodeIdentifier();
   *   console.log(`Connected to node: ${nodeInfo.nodeId}`);
   * } catch (error) {
   *   console.error('Failed to get node information:', error);
   * }
   * ```
   */
  async smartNodeIdentifier(): Promise<ISmartNetwork.IOperator.IEntity> {
    return new Promise(async (resolve, reject) => {
      try {
        let response = await this.smartClient.axios.get(
          '/smart-node/identifier'
        );

        resolve(response.data);
      } catch (error) {
        reject(error);
      }
    });
  }

  /**
   * Retrieves the Smart App identifier and subscription status
   * 
   * @description
   * Fetches identification details about the current Smart App instance
   * and its Web3 subscription status. This information includes:
   * - Application ID and version
   * - Subscription details and validity
   * - Connected network information
   * - Available services and capabilities
   * 
   * @returns Promise resolving to the Smart App identifier and subscription status
   * @throws Will reject the promise if the API request fails
   * 
   * @example
   * ```typescript
   * try {
   *   const appInfo = await smartAppService.smartAppIdentifier();
   *   console.log(`App ID: ${appInfo.id}, Subscription: ${appInfo.subscription.status}`);
   * } catch (error) {
   *   console.error('Failed to get app information:', error);
   * }
   * ```
   */
  async smartAppIdentifier(): Promise<any> {
    return new Promise(async (resolve, reject) => {
      try {
        let response = await this.smartClient.axios.get(
          '/subscriptions/web3/status'
        );

        resolve(response.data);
      } catch (error) {
        reject(error);
      }
    });
  }
}

import { Socket, io } from 'socket.io-client';
import { LoggerHelper } from '@hsuite/helpers';

/**
 * Web3Socket class for managing WebSocket connections to Hedera network services
 * 
 * This class provides a standardized interface for establishing and maintaining
 * WebSocket connections to Hedera network endpoints. It handles connection setup,
 * authentication, event handling, and provides access to the underlying socket instance.

* 
 * @class Web3Socket
 * @description Manages WebSocket connections to Hedera network services with authentication and event handling
 * @example
 * // Create a new Web3Socket instance
 * const socket = new Web3Socket(
 *   'https://api.example.com',
 *   'transactions',
 *   'your-access-token'
 * );
 * 
 * // Get the socket instance to listen for events
 * const socketInstance = socket.getSocket();
 * socketInstance.on('transaction', (data) => {
 *   console.log('New transaction:', data);
 * });
 */
export class Web3Socket {
  /**
   * Logger instance for logging connection events and errors
   * @private
   * @type {LoggerHelper}
   * @description Provides structured logging for socket connection events
   */
  private logger: LoggerHelper = new LoggerHelper(Web3Socket.name);

  /**
   * Authentication token for securing the WebSocket connection
   * @private
   * @type {string}
   * @description JWT or other token format used for authenticating with the WebSocket server
   */
  private accessToken: string;

  /**
   * Socket.io client instance that manages the WebSocket connection
   * @private
   * @type {Socket}
   * @description The underlying Socket.io client instance handling the connection
   */
  private socket: Socket;

  /**
   * Base URL of the WebSocket server
   * @private
   * @type {string}
   * @description The server URL (http/https) that will be converted to WebSocket protocol (ws/wss)
   */
  private url: string;

  /**
   * Topic or namespace for the WebSocket connection
   * @private
   * @type {string}
   * @description Identifies the specific service or event stream to connect to on the server
   */
  private topic: string;

  /**
   * Creates a new Web3Socket instance and initializes the connection
   * 
   * @constructor
   * @param {string} url - Base URL of the WebSocket server (http/https format)
   * @param {string} topic - Topic or namespace to connect to on the server
   * @param {string} accessToken - Authentication token for securing the connection
   * 
   * @description Initializes a new WebSocket connection with the provided parameters.

* The URL will be automatically converted from HTTP/HTTPS to WS/WSS protocol. */
  constructor(
    url: string,
    topic: string,
    accessToken: string
  ) {
    this.url = url;
    this.topic = topic;
    this.accessToken = accessToken;
    this.socket = this.init();
  }

  /**
   * Initializes the WebSocket connection with proper configuration
   * 
   * @private
   * @returns {Socket} Configured Socket.io client instance
   * 
   * @description Sets up the Socket.io connection with appropriate transport options,
   * authentication, and event handlers. Converts HTTP/HTTPS URLs to WS/WSS protocol. */
  private init() {
    let socketUrl = this.url.replace('https://', 'wss://').replace('http://', 'ws://');

    this.socket = io(`${socketUrl}/${this.topic}`, {
      upgrade: false,
      transports: ["websocket"],
      auth: {
        accessToken: this.accessToken
      }
    });

    this.socket.on("connect", async () => {
      this.logger.verbose(`Connected to socket.`);
    });

    this.socket.on("disconnect", async (event) => {
      this.logger.verbose(`Disconnected from socket.`);
    });

    return this.socket;
  }

  /**
   * Retrieves the active Socket.io client instance
   * 
   * @public
   * @returns {Socket} The active Socket.io client instance
   * 
   * @description Provides access to the underlying Socket.io client instance,
   * allowing consumers to register custom event handlers or emit events. * 
   * @example
   * const socket = new Web3Socket(url, topic, token);
   * const socketInstance = socket.getSocket();
   * 
   * // Listen for custom events
   * socketInstance.on('customEvent', (data) => {
   *   console.log('Custom event received:', data);
   * });
   * 
   * // Emit events to the server
   * socketInstance.emit('clientEvent', { message: 'Hello server' });
   */
  getSocket() {
    return this.socket;
  };
}

